import { Helmet } from 'react-helmet';
import StudioNav from './studioComps/StudioNav';
import StudioSidebar from './studioComps/StudioSidebar';
import { useEffect } from 'react';

export default function StudioHome({ userInfo }){

    const toggleSideBar = () => {
        
    }
    const something = () => {
        var btn = document.querySelector('.navbar .inner .left .menu #menu');
        var studioside = document.querySelector('.main .studioside');
        var studioscroll = document.querySelector('.main .studioscroll');

        btn.addEventListener('click', function(){
            studioside.classList.toggle('active');
            studioscroll.classList.toggle('active');
        })
    }
    useEffect(() => {
        something();
    }, [])


    return (
        <>
            <Helmet>
                <title>Channel Dashboard - YouTube</title>
            </Helmet>
            <StudioNav userInfo={userInfo} />
            <div className='main'>
                <StudioSidebar userInfo={userInfo} />
                <div className="studioscroll">
                    <div className="inner">
                        <div className="line">
                            Channel Home
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}
